import React, { useEffect, useState } from 'react';

function Main() {
  const [recipe, setRecipe] = useState([])

  const getRecipe = () => {
    const url = "www.themealdb.com/api/json/v1/1/random.php"
    fetch(url)
    .then(res => res.json())
    .then(res => {
      console.log(res)
      setRecipe(res)
    })
  }

  useEffect(() => {
    getRecipe()
  }, [])

  return (
    <div className="Main">
      <h1>{recipe}</h1>
    </div>
  );
}


export default Main;
